import {
    GoogleOutlined,
    GoogleSquareFilled,
    FacebookOutlined,
    ClusterOutlined
} from '@ant-design/icons';

export const items = [
    {
        key: 'GOOGLE_ANALITICS',
        icon: <GoogleOutlined />,
        label: 'Google analitics'
    },
    {
        key: 'GOOGLE_ADS',
        icon: <GoogleSquareFilled />,
        label: 'Google ads'
    },
    {
        key: 'META_ADS',
        icon: <FacebookOutlined />,
        label: 'Meta ads'
    },
    {
        key: 'CRM',
        icon: <ClusterOutlined />,
        label: 'CRM'
    },
];
